Patch Set 2:

> I don't believe mold supports (or intends to support) linker scripts.

So apparently mold linker script support can't handle https://github.com/qt/qtbase/blob/dev/src/corelib/QtCore.dynlist

but it can handle the version script generated by qt_internal_add_linker_version_script




  Qt_6_PRIVATE_API {
    qt_private_api_tag*;
    /* access/qdecompresshelper_p.h */
    *17QDecompressHelper*;
    /* access/qhsts_p.h */
    *10QHstsCache*;
    *17QHstsHeaderParser*;
    ...
 Qt_6 { *; };
Qt_6.0 {} Qt_6;
Qt_6.1 {} Qt_6.0;
Qt_6.2 {} Qt_6.1;
Qt_6.3 { qt_version_tag; } Qt_6.2

Patch Set 3:

This change is acceptable, in isolation. But it will forever propagate the alias name in QSettings, because of:

            if (v.userType() == QMetaType::QDateTime) {
                version = QDataStream::Qt_5_6;
                typeSpec = "@DateTime(";
            } else {
                version = QDataStream::Qt_4_0;
                typeSpec = "@Variant(";
            }

I don't think that's desireable.

I would prefer to request Qt 5 codebases add the QMetaType::registerNormalizedTypedef for the official name. That won't change what it writes, but will enable it to read Qt 6 names.
